pragma solidity ^0.8.0;

contract SmartContract is IERC721, Ownable, Functional, ControlledAccess {

 using Address for address;

 // Token name
 string private _name;

 // Token symbol
 string private _symbol;

 // URI Root Location for Json Files
 string private _baseURI;

 // Mapping from token ID to owner address
 mapping(uint256 => address) private _owners;

 // Mapping owner address to token count
 mapping(address => uint256) private _balances;

 // Mapping from token ID to approved address
 mapping(uint256 => address) private _tokenApprovals;

 // Mapping from owner to operator approvals
 mapping(address => mapping(address => bool)) private _operatorApprovals;

 // Specific Functionality
 bool public mintActive;
 bool public presaleActive;
 uint256 public price;
 uint256 public totalTokens;
 uint256 public numberMinted;
 uint256 public maxPerWallet;
 uint256 public maxPerTx;
 uint256 public reservedTokens;

 uint256 public startingIndex;
 uint256 public startingIndexBlock;
 mapping(address => uint256) private _tokensMintedby;

 /**
 * @dev Initializes the contract by setting a `name` and a `symbol` to the token collection.
 */
 constructor() {
 _name = "Doodle Noodles";
 _symbol = "Noods";

 mintActive = false;
 presaleActive = false;
 totalTokens = 5555; // 0-5554
 price = 0.01 ether;
 maxPerWallet = 5;
 maxPerTx = 5;
 reservedTokens = 40; // reserved for giveaways and such
 }

 //@dev See {IERC165-supportsInterface}. Interfaces Supported by this Standard
 function supportsInterface(bytes4 interfaceId) public view virtual override returns (bool) {
 return interfaceId == type(IERC721).interfaceId ||
 interfaceId == type(IERC721Metadata).interfaceId ||
 interfaceId == type(IERC165).interfaceId ||
 interfaceId == SmartContract.onERC721Received.selector;
 }

 // Standard Withdraw function for the owner to pull the contract
 function withdraw() public onlyOwner {
 uint256 balance = address(this).balance;
 payable(msg.sender).transfer(balance);
 }

 function getMessageHash(address _add) public view onlyOwner returns(bytes32){
 return keccak256(abi.encode(owner(), _add));
 }

 function getETHSignedMessageHash(bytes32 _messageHash) public view onlyOwner returns(bytes32){
 return keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", _messageHash));
 }
 
 function recoverSigner(bytes32 _ethSignedMessageHash, bytes memory _signature) public view onlyOwner returns(address) {
 (bytes32 r, bytes32 s, uint8 v) = splitSignature(_signature);
 return ecrecover(_ethSignedMessageHash, v, r, s);
 }

 function splitSignature(bytes memory _sig) public view onlyOwner returns (bytes32 r, bytes32 s, uint8 v){
 require(_sig.length == 65, "invalid signature length");

 assembly {
 r := mload(add(_sig, 32))
 s := mload(add(_sig, 64))
 v := byte(0, mload(add(_sig, 96)))
 }
